import React, { Component } from "react";

class header extends Component {
      render() {
            return (
                  <>
                        <img src={this.state.imageUrl} alt="image" />
                        <span className="badge bg-primary m-4">
                              {" "}
                              {this.formatCount()}{" "}
                        </span>
                        <button className="btn btn-secondary btn-sm">
                              {" "}
                              Increment{" "}
                        </button>
                  </>
            );
      }
}

export default header;
